// defineComponent函数,定义一个组件
import { defineComponent, ref } from "vue";
// import HelloWorld from './components/HelloWorld.vue';

export default defineComponent({
  name: 'app',
   setup() {
     let num = ref(1)
     console.log('num', num)
     function update() {
       num.value ++
     }
     return {
       num,
       update
     }
   }
})
